import React from 'react';
import {
  ScrollView,
  Text,
  View,
  ActivityIndicator,
  Image,
  Dimensions,
  TouchableOpacity
} from 'react-native';
import styles from "../styles";
import { connect } from 'react-redux';

// import CouponsMaker from "../library/couponsMaker";
const width = Dimensions.get("window").width; //full width

const CouponsMaker = props => {
  try {
    const content = props.map((coupons, i) => (
      <View key={i}>
        <Text>_id: {coupons._id}</Text>
        <Text>title: {coupons.title}</Text>
        <Image
          style={{width: width, height: 200}}
          source={{uri: coupons.base64image}}
        />
        <Text>Was: {(coupons.currentPrice - 0).toFixed(2)}$</Text>
        <Text>Now: {(coupons.discountedPrice - 0).toFixed(2)}$</Text>
        <Text>Only {coupons.amountCoupons} Coupons Left!</Text>
        <Text>{coupons.textarea}</Text>
        <Text>
              {coupons.address}, {coupons.city}
        </Text>
        <Text>
          {(
            ((coupons.currentPrice - coupons.discountedPrice) /
              coupons.currentPrice) *
              100
            ).toFixed(2)
            }
          % Percent Off!
        </Text>
        <Text>
          {
            "latitude: " +
            coupons.latitude +
            " longitude: " +
            coupons.longitude
          }
        </Text>
        <TouchableOpacity
          onPress={() => alert("get coupon")
          }
        >
          <Text> Get Coupon </Text>
        </TouchableOpacity>
      </View>
    ));
    return <View>{content}</View>;
  } catch (error) {
    return (
      <View>
          <Text>
          {JSON.stringify(error)}
          </Text>
      </View>
    );
  }
};
const couponData = [
  {
    title: "title 1",
    _id: "_id",
    base64image: "data:image/png;base64,",
    currentPrice: 1.00,
    discountedPrice: 0.50,
    amountCoupons: 100,
    textarea: "textarea",
    address: "1325 boylston street",
    latitude: 696969,
    longitude: 911911911,
    
  },
    {
    title: "title 2",
    _id: "_id",
    base64image: "data:image/png;base64,",
    currentPrice: 1.00,
    discountedPrice: 0.50,
    amountCoupons: 100,
    textarea: "textarea",
    address: "1325 boylston street",
    latitude: 696969,
    longitude: 911911911,
  }
]

let couponData2 = JSON.parse(JSON.stringify(couponData));
couponData2[0].title = "title 3"
couponData2[1].title = "title 4"

class HomeScreen extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      geolocation: "",
      latitude: "",
      longitude: "",
      city: "",
      pageNumber: 1,
      coupons: <ActivityIndicator size="large" />,
      incrementPageClass: "hidden"
    };
    this.back = this.back.bind(this);
    this.next = this.next.bind(this);
  }
  static navigationOptions = {
    header: null,
  };
  
  componentDidMount = () => this.setState({coupons: CouponsMaker(couponData)})

  next = () => {
    this.setState({coupons: CouponsMaker(couponData2)})
  }

  back = () => {
    this.setState({coupons: CouponsMaker(couponData)})
  }
  increment = () => {
    this.props.dispatch({ type: 'INCREMENT' });
  }

  decrement = () => {
    this.props.dispatch({ type: 'DECREMENT' });
  }

  render() {
    return (
      <View style={styles.container}>
        <ScrollView style={styles.container} contentContainerStyle={styles.contentContainer}>
            <Text style={styles.homeheader}>Coupons Near You {this.props.count}</Text>
          <TouchableOpacity
          onPress={this.decrement
          }
        >
          <Text> _ </Text>
        </TouchableOpacity>
        <TouchableOpacity
          onPress={this.increment
          }
        >
          <Text> + </Text>
        </TouchableOpacity>
            <View style={styles.contentContainer}>{this.state.coupons}</View>

        <TouchableOpacity
          onPress={this.back
          }
        >
          <Text> Back </Text>
        </TouchableOpacity>
        <TouchableOpacity
          onPress={this.next
          }
        >
          <Text> Next </Text>
        </TouchableOpacity>
        </ScrollView>
      </View>
    );
  }
}


const mapStateToProps = state => ({ count: state.count })

export default connect(mapStateToProps)(HomeScreen);
